import logo from './logo.svg';
import './App.css';

function App() {
  const bar = [
    <li>SignIn</li>,
    <li>Contatc</li>
  ]
  return (
    <div className="App">
      <header className="App-header">
        <a className="App-logo" href="./img/logo.JPG">Logo</a>
        <a className="App-link" href="App.js">
          Cheeky
        </a>
        <ul>
          {bar}
        </ul>
      </header>
    </div>
  );
}

export default App;
